import Inputfield from "../Inputfield/Inputfield";
const form_field =[
    {
     type:"text",
     id:"userid",
     class:"form-control",
     placeholder:"Email or phone number"

    },
    {
        type:"password",
        id:"password",
        class:"form-control",
        placeholder:"Password"
        
    },
    {
     type:"submit",
     id:"submit",
     class:"btn btn-primary",
     value:'Log in'
}
]
const Form =()=>{
    return (
    <form className="d-flex justify-content-center bg-success align-items-center">
        <div class="form-group row">
          {
            form_field.map((element,key)=>{
                return <Inputfield key={key} type={element.type} id={element.id} name={element.name} className={element.class} placeholder={element.placeholder}  value={element.value}/>
            })
          }
        </div>
         
      </form>
    )
}
export default Form ;
